import React from 'react'
import Button from '../UI/Button/Button'
import {useNavigate} from 'react-router-dom'

function Basiclayout(props) {
const navigate=useNavigate()

  return (
    <div style={{display: "flex", height: "100%", justifyContent:"center"}}>
      <div style={{backgroundColor: "pink", width: "20vw", height: "100vh"}}>
        <nav className='Nav-Bar'>
            
            <li className='link-list'>Dashboard</li>
            <li className='link-list'>People</li>
            <li className='link-list'>Add People</li>
            
        </nav>

      </div>
      <div style={{backgroundColor: "white", width: "80vw", height: "100vh"}}>
        <div style={{width: "100%", height: "100px", backgroundColor:"skyblue"}}>
            
        <Button className="button" onClick={()=>{
          localStorage.removeItem('token');
          navigate('/');
        }}>Logout</Button>
        </div>
        <div style={{width: "100%", height: "100%"}}>
            {props.children}
        </div>

      </div>
    
    </div>
  )
}

export default Basiclayout
